		E7A4738514F334A8009CF8DA /* PBXBuildRule */ = {
			isa = PBXBuildRule;
			compilerSpec = com.apple.compilers.proxy.script;
			filePatterns = "*.exp-in";
			fileType = pattern.proxy;
			inputFiles = (
			);
			isEditable = 1;
			outputFiles = (
				"$(BUILT_PRODUCTS_DIR)/corecrypto_dylib.$(CURRENT_ARCH).exp",
			);
			script = "#!/bin/sh\n\necho \"HEADER_SEARCH_PATHS: (${HEADER_SEARCH_PATHS})\"\n#Insert -I between paths. Some path may contain whitespaces so that, '\\ ' are ignored. Special case for the first path.\nHEADER_SEARCH_OPTIONS=$(echo \"${HEADER_SEARCH_PATHS}\" | sed -e 's/\\([^\\]\\)  */\\1 -I /g'  | sed -e 's/^ */-I /g')\necho \"HEADER_SEARCH_OPTIONS: (${HEADER_SEARCH_OPTIONS})\"\n\necho \"GCC_PREPROCESSOR_DEFINITIONS: (${GCC_PREPROCESSOR_DEFINITIONS})\"\n#Insert -D between macros.\nGCC_PREPROCESSOR_OPTIONS=$(echo \"${GCC_PREPROCESSOR_DEFINITIONS}\" | sed -e 's/\\([^\\]\\)  */\\1 -D/g'  | sed -e 's/^ */-D/g')\necho \"GCC_PREPROCESSOR_OPTIONS: (${GCC_PREPROCESSOR_OPTIONS})\"\n\necho \"OTHER_CFLAGS: (${OTHER_CFLAGS})\"\n\n#Path to clang\nCC_CLANG=$(xcrun --find clang)\n\n#Run clang. Don't use xcrun directly for whitepace support.\n\"${CC_CLANG}\" ${GCC_PREPROCESSOR_OPTIONS} \"${SCRIPT_OTHER_CFLAGS}\" -E -Xpreprocessor -P -x c -arch ${CURRENT_ARCH} \"${HEADER_SEARCH_OPTIONS}\" \"${INPUT_FILE_PATH}\" -o \"${BUILT_PRODUCTS_DIR}/corecrypto_dylib.${CURRENT_ARCH}.exp\"\n";
